webpackJsonp([0xc86afca0740e],{341:function(A,e){A.exports={data:{markdownRemark:{html:'<p>This is a little react app that allows you to manipulate SVG patterns and see them in a grid. Created for <a href="https://sabinehill.com/" target="_blank">Sabine Hill</a>, it allows customers to preview their choices of tile color and arrangement.</p>\n<p>This project was all about manipulating SVG data in react.</p>\n<p>Since tracing the 30-plus SVG patterns and then editing them by hand in order to make them play nicely with React didn\'t seem like something I wanted to do, in true developer fashion, I also created a nice little node command-line tool that does the work for me ðŸ‘Œ.</p>\n<p>I\'ve included to tile customizer itself here, so have a play!</p>\n<div style="background: white;">\n  <iframe src="https://8ctopotamus.github.io/sabine-hill-tile-customizer" width="100%" height="1600px"></iframe>\n</div>',frontmatter:{path:"/sabine-hill-tile-customizer",title:"Sabine Hill Tile Customizer",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.7297297297297298,src:"/static/sabine-hill-tile-customizer-a81252d4662b79a80e246fd936800efd-f2ac0.jpg",srcSet:"/static/sabine-hill-tile-customizer-a81252d4662b79a80e246fd936800efd-567e3.jpg 158w,\n/static/sabine-hill-tile-customizer-a81252d4662b79a80e246fd936800efd-c3206.jpg 315w,\n/static/sabine-hill-tile-customizer-a81252d4662b79a80e246fd936800efd-f2ac0.jpg 630w,\n/static/sabine-hill-tile-customizer-a81252d4662b79a80e246fd936800efd-0c4a5.jpg 945w,\n/static/sabine-hill-tile-customizer-a81252d4662b79a80e246fd936800efd-211f3.jpg 1260w,\n/static/sabine-hill-tile-customizer-a81252d4662b79a80e246fd936800efd-1a402.jpg 1280w",sizes:"(max-width: 630px) 100vw, 630px"}}}}}},pathContext:{}}}});
